DROP TABLE IF EXISTS `remito`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `remito` (
  `id_remito` int NOT NULL AUTO_INCREMENT,
  `id_pedido` int NOT NULL,
  `id_usuario` int NOT NULL,
  `numero_remito` varchar(15) NOT NULL DEFAULT 'R00001-00000001',
  `fecha` date NOT NULL DEFAULT (curdate()),
  `transporte` varchar(245) DEFAULT NULL,
  `detalle` varchar(245) DEFAULT NULL,
  PRIMARY KEY (`id_remito`),
  KEY `fk_remito_pedido` (`id_pedido`),
  KEY `fk_remito_usuario` (`id_usuario`),
  CONSTRAINT `fk_remito_pedido` FOREIGN KEY (`id_pedido`) REFERENCES `pedido` (`id_pedido`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_remito_usuario` FOREIGN KEY (`id_usuario`) REFERENCES `usuario` (`id_usuario`) ON DELETE CASCADE ON UPDATE CASCADE
